import HeaderPage from "./HeaderPage";
import NextHeader from "./NextHeader";
import pic from './teslaimg/D_PW_Hero_2880x1800.jpeg'
import back from './teslaimg/solar-roof_value_D.jpg'
const Powerwall = () => {
    return ( 
        <div>
<HeaderPage
         title="Solar for Existing Roofs "
         background={back}
         description="Plaid"
         range="120min"
         time=""
         speed="$"
         horsepower="24/7"
         first
         second
      />
      <NextHeader
       background={pic}
      />
      </div>
     )
 
    ;
}
 
export default Powerwall;
  <HeaderPage />
